import React from "react";

function Check() {
  return (
    <div>
      <h1>Check</h1>
      <ul>
        {/* This will be the closest to a to-do list */}
        <li>Condition</li>
        {/* This will be tied to system date/time */}
        <li>Time</li>
      </ul>
    </div>
  );
}

export default Check;
